import styled from "styled-components";

export const Button = styled.button`
    color: black;
    font-size: 1em;
    margin: 1em;
    padding: 0.25em 1em;
    border: 2px solid black;
    border-radius: 3px;
` 
export const H3 = styled.h3`
    font-size: 3em;
    text-align: center;
    color: palevioletred;

`

export const Div = styled.div`
    background-color: gray;

`
